import React from "react";
import "./Navbar.css";

export default function Navbar() {
  return (
    <header className="navbar-container">

      {/* Left Section: LBRCE Logo + Text */}
      <div className="left-logo">
        <img src="/lbrcelogo.jpg" alt="LBRCE Logo" className="lbrce-img" />

        <div className="lbrce-title">
          <span>L</span>
          <span>B</span>
          <span>R</span>
          <span>C</span>
          <span>E</span>
        </div>
      </div>

      {/* Right Section: InnovateHub Title */}
      <div className="right-title">
        <h1>InnovateHub</h1>
        <p>A Unified Portal for Innovation Insights and Research</p>
      </div>

    </header>
  );
}
